import React from 'react'
import styles from '../../nav.module.css'

type ClickType = {
  onClickHandler?: () => void
}

export const Button: React.FC<ClickType> = ({ onClickHandler }) => {
  return (
    <>
      <button type="submit" className={styles.buttonTweet} onClick={onClickHandler}>
        Tweet
      </button>
    </>
  )
}
